;; **
;;; ## Read
;; **

;; **
;;; * Get the latest database value from a connection
;; **

;; @@
(def db (client/db conn))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;datomic-doc.tutorial/db</span>","value":"#'datomic-doc.tutorial/db"}
;; <=

;; **
;;; * Pull: pull the color, type, and size for SKU-42
;; **

;; @@
(<!! (client/pull
      db
      {:eid [:inv/sku "SKU-42"]
       :selector [{:inv/color [:db/ident]}
                  {:inv/size [:db/ident]}
                  {:inv/type [:db/ident]}]}))
