;; **
;;; * Query: finds the skus of all products that share a color with SKU-42
;; **

;; @@
(<!! (client/q
       conn
       {:query '[:find ?sku
                 :where
                 [?e :inv/sku "SKU-42"]
                 [?e :inv/color ?color]
                 [?e2 :inv/color ?color]
                 [?e2 :inv/sku ?sku]]
        :args [db]}))
